import React from 'react';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  return (
    <div>
      <h1>WELCOME TO API ASSIGNMENT</h1>
      <div>
        <Link to="/healthcheck"><button>Health Check</button></Link>
        <Link to="/getalldevices"><button>Get All Devices</button></Link>
        <Link to="/getdevicescount"><button>Get Devices Count</button></Link>
        <Link to="/getnotificationcount"><button>Get Notification Count</button></Link>
        <Link to="/adddevice"><button>Add Device</button></Link>
        <Link to="/deletedevice"><button>Delete Device</button></Link>
      </div>
    </div>
  );
};

export default Dashboard;
